-- Table: django_apscheduler_djangojobexecution
CREATE TABLE IF NOT EXISTS django_apscheduler_djangojobexecution (
    id        INTEGER        NOT NULL
                             PRIMARY KEY AUTOINCREMENT,
    status    VARCHAR (50)   NOT NULL,
    run_time  DATETIME       NOT NULL,
    duration  DECIMAL,
    finished  DECIMAL,
    exception VARCHAR (1000),
    traceback TEXT,
    job_id    VARCHAR (255)  NOT NULL
                             REFERENCES django_apscheduler_djangojob (id) DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT unique_job_executions UNIQUE (
        job_id,
        run_time
    )
);


